import './WhatWeDo.css';

import { Col, Container, Row } from "react-bootstrap";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faAtom, faCompass } from '@fortawesome/free-solid-svg-icons'

function WhatWeDo(){

    const element = <FontAwesomeIcon icon={faAtom} />
    const element2 = <FontAwesomeIcon icon={faCompass} />
    const element3 = <FontAwesomeIcon icon={faAtom} />

    const ArraysWhatWeDo = [{
        id: 1,
        image: element,
        title: 'Branding'
    },
    {
        id: 2,
        image: element2,
        title: 'Web Design'
    },
    {
        id: 3,
        image: element3,
        title: 'App Design'
    }];
    const ArraysWhatWeDoOnMap = ArraysWhatWeDo.map((ArrayWhatWeDo) =>
    <Col key = {ArrayWhatWeDo.id} lg = "4" md = "6" sm = "12">
        <div className = "whatwedo-wrapper">
            <img src = {ArrayWhatWeDo.image} className = "w-100"/>
            <h3>{ArrayWhatWeDo.title}</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Omnis repellat quo vitae tempora.</p>
            <a href = "" className = "whatwedo-link">Learn More</a>
        </div>
    </Col>
    )

    return(
        <Container fluid>
            <Container>
                <div className = "whatwedo border">
                    <p>What we do</p>
                    <h1>Our Services For Your Business</h1>

                    <Row>
                        {ArraysWhatWeDoOnMap}
                    </Row>
                </div>
            </Container>
        </Container>
    )
}

export default WhatWeDo
